import {Component, OnDestroy, OnInit} from '@angular/core';
import {ActivatedRoute} from "@angular/router";
import {Subscription} from "rxjs";

@Component({
  selector: 'app-questionnaire-answers',
  templateUrl: './questionnaire-answers.component.html',
  styleUrls: ['./questionnaire-answers.component.css']
})
export class QuestionnaireAnswersComponent implements OnInit, OnDestroy {
  private activatedRoute: ActivatedRoute;

  formId: bigint;

  private subscription: Subscription;

  constructor(activatedRoute: ActivatedRoute) {
    this.activatedRoute = activatedRoute;
  }

  ngOnInit() {
    this.subscription = this.activatedRoute.params
      .subscribe(params => {
        this.formId = params['id'];
      });
  }

  ngOnDestroy() {
    if (this.subscription)
      this.subscription.unsubscribe();
  }
}
<div class="main-body">
  <app-header></app-header>
  <app-error></app-error>

  <app-large-area
    title="Ответы"
    [buttonBackRoute]="['/my-form-fields', formId]"
  >
    <app-manage-answers
      *ngIf="formId"
      [formId]="formId"
    ></app-manage-answers>
  </app-large-area>
</div>
